def lastToFirst(i,bwt):

    rankChars=['$','A','C','G','T']
    occurences=0    
    checkChar=bwt[i]
     
    indexOfCheckChar=rankChars.index(checkChar)    
    for j in range(0,indexOfCheckChar):
        occurences+=bwt.count(rankChars[j])    
    #checks occurences of current character before the given index
    slicedBWT=bwt[:i]    
    occurenceOfCurrentChar=slicedBWT.count(checkChar)   
    return occurences+occurenceOfCurrentChar 

def BwMatching(lastColumn, pattern):
    lastColumn=list(lastColumn)
    
    top = 0
    bottom = (len(lastColumn))-1
    while top <= bottom:
        if len(pattern)!=0:
            symbol =pattern[-1]            
            pattern=pattern[:-1]
           
            if symbol in lastColumn[top:bottom+1]:            
                
                topIndex = top+lastColumn[top:bottom+1].index(symbol)                
                lastColumnReverse = lastColumn[top:bottom+1][::-1]                
                bottomIndex = bottom-lastColumnReverse.index(symbol)                
                top = lastToFirst(topIndex,lastColumn)               
                bottom = lastToFirst(bottomIndex,lastColumn)
               
            else:
                return 0
        else:
            
            return bottom - top + 1
  
   
        

    
